Juan korraldab oma margikogu riikide ja kümnendite kaupa, millal need välja anti. Hinnad, mida ta margipoes nende eest maksis, olid: Brasiilia ja Prantsusmaa, $6$ senti igaüks, Peruu $4$ senti igaüks ja Hispaania $5$ senti igaüks. (Brasiilia ja Peruu on Lõuna-Ameerika riigid ning Prantsusmaa ja Hispaania on Euroopas.) [asy]
